tvgaControllers.controller('PhotoCtrl', ['$scope', '$filter', '$element', 'cameraPhoto', 'cacheDb', 
function($scope, $filter, $element, cameraPhoto, cacheDb) {

    $scope.tkyFrame;
    $scope.showHelp = false;
    $scope.dummyphoto = "";
    $scope.canvasHeight = 1024;
    $scope.canvasWidth = 1024;
    $scope.canvasMarginTop = -($element[0].clientWidth*1.06);
    $scope.canvasMarginLeft = ($element[0].clientWidth*0.03);
    $scope.canvasScale = ($element[0].clientWidth*0.94)/1024;
    $scope.ctrlOffset = (1024*$scope.canvasScale)-50;
    $scope.ctrlStyle = "-ms-transform-origin:0% 0%; -webkit-transform-origin: 0% 0%; transform-origin: 0% 0%; -ms-transform: translate(0px,"+$scope.ctrlOffset+"px); -webkit-transform: translate(0px,"+$scope.ctrlOffset+"px); transform: translate(0px,"+$scope.ctrlOffset+"px);"
    $scope.canvasStyle = "-ms-transform-origin:0% 0%; -webkit-transform-origin: 0% 0%; transform-origin: 0% 0%; -ms-transform: scale("+$scope.canvasScale+"); -webkit-transform: scale("+$scope.canvasScale+"); transform: scale("+$scope.canvasScale+");"
    $scope.canvasHide = true;
    $scope.canvasMsg = "TAKE A PICTURE";
    
    $scope.Init = function(){
        //alert(device.uuid);
        
        var frameOpts = {
    		        canvas: 'picturizer',
			        width:1024,
			        height:1024,
			    };
        
        $scope.tkyFrame = new PbFrame(frameOpts);
        //$scope.tkyFrame.SetPbImage("data:image/jpeg;base64,"+$scope.dummyphoto);
    };
    
    $scope.GetPicture = function(){
        try{
            ga('send', 'event', 'button', 'click', 'photo_get', 0);
        }catch(exception){
            console.log("ga fail");
        }
        if( navigator.camera ){
            navigator.camera.getPicture($scope.PhotoSuccess, $scope.PhotoFail, { 
                quality: 80,
                destinationType: 0,
            	correctOrientation: true,
    			encodingType: 0,
      			targetWidth: 1024,
      			targetHeight: 1024,
      			saveToPhotoAlbum: false
        	    });
        }else{
            $scope.PhotoSuccess($scope.dummyphoto);
        }
    };
    
    $scope.PhotoSuccess = function(imageData) {
        try{
            ga('send', 'event', 'button', 'click', 'photo_set', 0);
        }catch(exception){
            console.log("ga fail");
        }
        $scope.canvasHide = false;
        $scope.tkyFrame.SetPbImage("data:image/jpeg;base64,"+imageData);
        $scope.tkyFrame.fstage.update();
        $scope.$apply();
        //cameraPhoto.SetPhoto(imageData);
        //myNavigator.pushPage('volumizer.html');
    };
    
    $scope.PhotoFail = function(message) {
        try{
            ga('send', 'event', 'button', 'click', 'photo_fail', 0);
        }catch(exception){
            console.log("ga fail");
        }
        console.log('Failed because: ' + message);
        myNavigator.pushPage('volumizer.html');
    };
    
    $scope.StorePhoto = function(){
        try{
            ga('send', 'event', 'button', 'click', 'photo_save', 0);
        }catch(exception){
            console.log("ga fail");
        }
        //var img = $scope.tkyFrame.fstage.canvas.toDataURL("image/png");
        //cameraPhoto.SetPhoto(img);
        cacheDb.Set('canvasPhoto', $scope.tkyFrame.fstage.canvas.toDataURL("image/png")).then(function(result) {
            $scope.tkyFrame.Destroy();
            $scope.tkyFrame = null;
            myNavigator.pushPage('volumizer.html');
        }).catch(function(error) {
            console.log('catching for some reason');
            alert("Could not save photo. Please try again.")
        });
    };
    
    $scope.Init();
    
}]);